import { GET_DATA } from "../types"
import { data } from "../../components/utlis/data"

const initialState = {
  foodmenu: {}
}

export default function(state = initialState, action) {
  console.log(action.payload)

  switch (action.type) {
    case GET_DATA:
      return {
        ...state,
        foodmenu: { data }
      }
    default:
      return state
  }
  console.log(state.foodmenu)
}
